    font-size: 16px;
    color: #fff;
    font-weight:400;
`
const SpanCripto = styled.span`
    color: #eeeeee;
    font-weight: 700;
`

const Resultado = ({resultadoFinal}) => {

    const { PRICE, HIGHDAY, LOWDAY, CHANGEPCT24HOUR , IMAGEURL, LASTUPDATE } = resultadoFinal

  return (
        <>

            <TextoCripto>
                EL PRECIO ES DE : <SpanCripto> {PRICE} </SpanCripto>
            </TextoCripto>

        </>
  )
}

export default Resultado
